import React, { useEffect, useState } from "react";
import Link from "next/link";
import Layout from "../components/Layout";

export default function Index() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/posts")
      .then((response) => {
        return response.json();
      })
      .then((json) => {
        setData(json);
      });
  });

  return (
    <Layout>
      <div className='p-4 shadow-lg rounded  bg-gradient-br-red-blue'>
        <h1 className='blue-green text-primary'>Next.js</h1>
        <p className='text-primary'>with Tailwind CSSSS</p>
        <div class='bg-white dark:bg-black'>
          <p class='text-black dark:text-white'>
            My eyes are grateful.
            <a class='text-blue-300 hover:text-blue-400 dark:text-blue-700 dark-hover:text-blue-600'>
              Learn more
            </a>
          </p>
        </div>
        {data.map((item) => {
          return (
            <div>
              <Link href={`/aukcje/${item.id}`}>{item.title}</Link>
            </div>
          );
        })}
        <Link href='/about' title='About Page'>
          <a>About Page</a>
        </Link>
      </div>
    </Layout>
  );
}
